import logo from './logo.svg';
import './App.css';
import React from "react";
import ResponsiveAppBar from "./Layout/Header"
function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
      <ResponsiveAppBar/>
      <div>App will go here.</div>
    </div>
  );
}

export default App;
